import useFetchData from '../hooks/fetchData';


const ProductPage = () => {

    const { data, error, loading } = useFetchData('posts');


    if(error){
        return(
            <div>
                there was an error
            </div>
        );
    }

    if(loading){
        return(
            <div>
                THE PAGE IS LOADING
            </div>
        )
    }

    return(
        <div>
            <div>
                This is the whole product page
            </div>
        </div>
    );
}


export default ProductPage;
